        ///   Looks up a localized string similar to Use Separate Document Numbers When Creating Retainage Documents.
        /// </summary>
        public static string UseSeparateDocuments {
            get {
                return ResourceManager.GetString("UseSeparateDocuments", resourceCulture);
            }
        }
    }
}
